import React, { useState } from 'react';
import {
  Box,
  Typography,
  TextField,
  Button,
  Table,
  TableBody,
  TableCell,
  TableContainer,
  TableHead,
  TableRow,
  Paper,
  IconButton,
} from '@mui/material';
import AddIcon from '@mui/icons-material/Add';
import DeleteIcon from '@mui/icons-material/Delete';

const Facturacion = () => {
  const [productos, setProductos] = useState([
    { descripcion: '', cantidad: 1, precio: 0, subtotal: 0 },
  ]);
  const [totales, setTotales] = useState({ subtotal: 0, igv: 0, total: 0 });

  const handleProductoChange = (index: number, field: string, value: string | number) => {
    const nuevosProductos = [...productos];
    nuevosProductos[index][field] = field === 'cantidad' || field === 'precio' ? parseFloat(value as string) : value;
    nuevosProductos[index].subtotal = nuevosProductos[index].cantidad * nuevosProductos[index].precio;
    setProductos(nuevosProductos);
    calcularTotales(nuevosProductos);
  };

  const calcularTotales = (productos: any[]) => {
    const subtotal = productos.reduce((acc, prod) => acc + prod.subtotal, 0);
    const igv = subtotal * 0.18;
    const total = subtotal + igv;
    setTotales({ subtotal, igv, total });
  };

  const agregarProducto = () => {
    setProductos([...productos, { descripcion: '', cantidad: 1, precio: 0, subtotal: 0 }]);
  };

  const eliminarProducto = (index: number) => {
    const nuevosProductos = productos.filter((_, i) => i !== index);
    setProductos(nuevosProductos);
    calcularTotales(nuevosProductos);
  };

  return (
    <Box sx={{ p: 2 }}>
      {/* Encabezado */}
      <Typography variant="h5" sx={{ mb: 1, color: '#1e3a8a' }}>
        Facturación Electrónica
      </Typography>

      {/* Información de la factura */}
      <Box sx={{ display: 'flex', gap: 1, mb: 2 }}>
        <TextField label="RUC" variant="outlined" size="small" fullWidth required />
        <TextField label="N° Factura" variant="outlined" size="small" fullWidth required />
        <TextField label="Fecha" type="date" variant="outlined" size="small" fullWidth InputLabelProps={{ shrink: true }} required />
      </Box>

      {/* Información del cliente */}
      <Box sx={{ display: 'flex', gap: 1, mb: 2 }}>
        <TextField label="Cliente" variant="outlined" size="small" fullWidth required />
        <TextField label="RUC/DNI" variant="outlined" size="small" fullWidth required />
        <TextField label="Dirección" variant="outlined" size="small" fullWidth />
      </Box>

      {/* Detalle de productos/servicios */}
      <TableContainer component={Paper} sx={{ mb: 2 }}>
        <Table size="small">
          <TableHead>
            <TableRow>
              <TableCell>Descripción</TableCell>
              <TableCell align="right">Cantidad</TableCell>
              <TableCell align="right">Precio Unitario (S/.)</TableCell>
              <TableCell align="right">Subtotal (S/.)</TableCell>
              <TableCell align="center">Acciones</TableCell>
            </TableRow>
          </TableHead>
          <TableBody>
            {productos.map((producto, index) => (
              <TableRow key={index}>
                <TableCell>
                  <TextField
                    variant="outlined"
                    size="small"
                    fullWidth
                    value={producto.descripcion}
                    onChange={(e) => handleProductoChange(index, 'descripcion', e.target.value)}
                  />
                </TableCell>
                <TableCell align="right">
                  <TextField
                    type="number"
                    variant="outlined"
                    size="small"
                    value={producto.cantidad}
                    onChange={(e) => handleProductoChange(index, 'cantidad', e.target.value)}
                  />
                </TableCell>
                <TableCell align="right">
                  <TextField
                    type="number"
                    variant="outlined"
                    size="small"
                    value={producto.precio}
                    onChange={(e) => handleProductoChange(index, 'precio', e.target.value)}
                  />
                </TableCell>
                <TableCell align="right">{producto.subtotal.toFixed(2)}</TableCell>
                <TableCell align="center">
                  <IconButton color="error" onClick={() => eliminarProducto(index)}>
                    <DeleteIcon />
                  </IconButton>
                </TableCell>
              </TableRow>
            ))}
          </TableBody>
        </Table>
      </TableContainer>
      <Button variant="outlined" size="small" startIcon={<AddIcon />} onClick={agregarProducto}>
        Agregar Producto
      </Button>

      {/* Totales */}
      <Box sx={{ display: 'flex', justifyContent: 'flex-end', gap: 1, mt: 2 }}>
        <TextField label="Subtotal (S/.)" variant="outlined" size="small" value={totales.subtotal.toFixed(2)} disabled />
        <TextField label="IGV (18%)" variant="outlined" size="small" value={totales.igv.toFixed(2)} disabled />
        <TextField label="Total (S/.)" variant="outlined" size="small" value={totales.total.toFixed(2)} disabled />
      </Box>

      {/* Botones */}
      <Box sx={{ display: 'flex', justifyContent: 'flex-end', gap: 1, mt: 2 }}>
        <Button variant="contained" color="primary" size="small">
          Guardar
        </Button>
        <Button variant="outlined" color="secondary" size="small">
          Cancelar
        </Button>
      </Box>
    </Box>
  );
};

export default Facturacion;
